import Typed from "typed.js";
import { useEffect, useRef } from "react";

const Writing = () => {

  const el = useRef(null);

  useEffect(() => {
    const typed = new Typed(el.current, {
      strings: ["Winners", "Fighter", "Legend"],
      startDelay: 300,
      typeSpeed: 150,
      backSpeed: 150,
      backDelay: 150,
      smartBackspace: true,
      loop: true,
      showCursor: false,
    });


    return () => {
      typed.destroy();
    };
  }, []);

  return (
    <div className="Content">
      <h6>
        Tempus = <span ref={el} />
      </h6>
    </div>
  );
};
export default Writing;
